import Top from "../components/interface/top"
import Slider from '../components/slider'
import Info from "../components/interface/sales"
import Bottom from "../components/interface/bot"

function Coba()
{
    return(
        <>
            <Top/>
            <Slider/>
            <Info/>
            <Info/>
        </>
    )
}
export default Coba
